async def test_get_patient_management(client):
    """Test case for get_patient_management

    getPatientManagement
    """
    headers = { 
        'Accept': 'application/json',
    }
    response = await client.request(
        method='GET',
        path='/patientmanagement/{user_id}/group/{group_id}/identifier/{identifier_id}'.format(user_id=56, group_id=56, identifier_id=56),
        headers=headers,
        )
    assert response.status == 200, 'Response body is : ' + (await response.read()).decode('utf-8')


